import styles from "./loading.module.css";

function Loading() {
	return (
		<div className={styles.spinnerGroup}>
			<div className={styles.spinnerBody}></div>
			<p className={styles.spinnerP}>Loading...</p>
		</div>
	);
}

export default Loading;
